import React from 'react';
import styled from 'styled-components';

const StyledTab = styled.div`
  .active {
    background-color: blue;
  }
`
const Tab = ({room, deleteAndUpdate, update, className}) => {
  return (
    <StyledTab>
      <span onClick={update}>
        {room}
      </span>
      <button onClick={deleteAndUpdate}/>
    </StyledTab>
  )
}

export default Tab;
